import './App.css';

let name = 'Sidessh'

function App() {
  return (
    <>
    <nav>
      <li>Home</li>
      <li>About</li>
      <li>Contact</li>
      <div className="container">
        <h1>Hello! {name}</h1>
        <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Minus asperiores eligendi quibusdam natus eveniet ipsam optio ipsa, eum laboriosam ad vero maiores consequatur quasi fugit dolorum quod, corporis incidunt, dolor quisquam harum voluptatibus. Laboriosam!</p>
      </div>
    </nav>
    </>
  );
}

export default App;
